    public class Solution11
    {
        public int FindUnsortedSubarray(int[] nums)
        {
            if (nums == null)
            {
                return 0;
            }
            else if (nums.Length == 0)
            {
                return 0;
            }

            int? startIndex = null;
            int? endIndex = null;

            for (int i = 0, j = nums.Length; i < nums.Length && j >= 0; i++, j--)
            {
                if (i > 0 && nums[i] < nums[i - 1])
                {
                    for (int k = i - 1; k >= 0; k--)
                    {
                        if (nums[k] > nums[i])
                        {
                            startIndex = k;
                        }
                    }
                }

                if (j < nums.Length - 2 && nums[j] > nums[j + 1])
                {
                    for (int k = j + 1; k < nums.Length; k++)
                    {
                        if (nums[k] < nums[j])
                        {
                            endIndex = k;
                        }
                    }
                }
            }

            if (endIndex.HasValue && startIndex.HasValue)
            {
                return endIndex.Value - startIndex.Value + 1;
            }
            else
            {
                return 0;
            }
            
        }

        public int FindUnsortedSubarray2(int[] nums)
        {
            if (nums == null)
            {
                return 0;
            }
            else if (nums.Length == 0)
            {
                return 0;
            }

            int startIndex = -1;
            int endIndex = startIndex;

            for (int i = 0; i < nums.Length; i++)
            {
                // find the index where the order is broken
                if (i > 0 && nums[i] < nums[i - 1])
                {
                    for (int k = i; k < nums.Length; k++)
                    {
                        if (nums[k] == nums[i])
                        {
                            endIndex = k;
                        }
                    }

                    // travel backwards to find the start
                    if (startIndex == -1)
                    {
                        for (int j = i - 1; j >= 0; j--)
                        {
                            if (nums[j] > nums[i])
                            {
                                startIndex = j;
                            }
                        }
                    }
                }                
            }

            if (startIndex == -1 && endIndex == -1)
            {
                return 0;
            }
            else
            {
                return endIndex - startIndex + 1;
            }
        }
    }

