        Dictionary<int, int> values = new Dictionary<int, int>();

        public int[] FindFrequentTreeSum(TreeNode root)
        {
            if (root == null)
            {
                return new int[0];
            }

            if (root.left != null && root.right != null)
            {
                int total = root.left.val + root.right.val + root.val;
                AddToDict(total);
            }
            else if (root.left != null)
            {
                int total = root.left.val + root.val;
                AddToDict(total);
            }
            else if (root.right != null)
            {
                int total = root.right.val + root.val;
                AddToDict(total);
            }
            else
            {
                int total = root.val;
                AddToDict(total);
            }

            if (root.left != null)
            {
                AddToDict(root.left.val);
            }

            if (root.right != null)
            {
                AddToDict(root.right.val);
            }

            if (values.Count == 1)
            {
                return values.Keys.ToArray();
            }
            else if (values.Count == 2)
            {
                return values.OrderByDescending(x => x.Value).Select(x => x.Value).Take(1).ToArray();
            }
            else
            {
                return values.Keys.ToArray();
            }
        }

        private void AddToDict(int total)
        {
            if (values.ContainsKey(total))
            {
                int currentValue = values[total];
                currentValue++;
                values[total] = currentValue;
            }
            else
            {
                values[total] = 1;
            }
        }

