        private int? GetValue(TreeNode root)
        {
            if (root == null)
            {
                return null;
            }

            int? leftValue = GetValue(root.left);
            int? rightValue = GetValue(root.right);
            int? nodeValue = root.val;

            int? totalValue = null;

            if (leftValue.HasValue)
            {
                totalValue = totalValue.HasValue ? totalValue.Value + leftValue.Value : leftValue;
            }

            if (rightValue.HasValue)
            {
                totalValue = totalValue.HasValue ? totalValue.Value + rightValue.Value : rightValue;
            }

            if (nodeValue.HasValue)
            {
                totalValue = totalValue.HasValue ? totalValue.Value + nodeValue.Value : nodeValue;
            }

            return totalValue;
        }
    }

