    {
        Dictionary<char, int> characterMap = new Dictionary<char, int>()
        {
            { 'a', 2 },
            { 'b', 3 },
            { 'c', 3 },
            { 'd', 2 },
            { 'e', 1 },
            { 'f', 2 },
            { 'g', 2 },
            { 'h', 2 },
            { 'i', 1 },
            { 'j', 2 },
            { 'k', 2 },
            { 'l', 2 },
            { 'm', 3 },
            { 'n', 3 },
            { 'o', 1 },
            { 'p', 1 },
            { 'q', 1 },
            { 'r', 1 },
            { 's', 2 },
            { 't', 1 },
            { 'u', 1 },
            { 'v', 3 },
            { 'w', 1 },
            { 'x', 3 },
            { 'y', 1 },
            { 'z', 3 },
        };

        public string[] FindWords(string[] words)
        {
            if (words == null)
            {
                return null;
            }
            else if (words.Length == 0)
            {
                return new string[0];
            }

            List<string> validwords = new List<string>();

            foreach (var item in words)
            {
                string lowerCase = item.ToLowerInvariant();

                int row = characterMap[lowerCase[0]];
                bool sameRow = true;

                for (int i = 1; i < lowerCase.Length; i++)
                {
                    int innerRow = characterMap[lowerCase[i]];
                    if (innerRow != row)
                    {
                        sameRow = false;
                        break;
                    }
                }

                if (sameRow)
                {
                    validwords.Add(item);
                }
            }

            return validwords.ToArray();
        }
    }

    public class Solution8
    {
        public int MaxRotateFunction(int[] A)
        {
            int maxValue = int.MinValue;

            if (A.Length == 0)
            {
                return 0;
            }

            for (int i = 0; i < A.Length; i++)
            {
                int value = CalculateValue2(A, i);
                maxValue = value > maxValue ? value : maxValue;
            }

            return maxValue;
        }

        private int CalculateValue(int[] A, int k)
        {
            int[] rotatedArray = RotateArray(A, k);

            int value = 0;

            for (int i = 0; i < rotatedArray.Length; i++)
            {
                value += i * rotatedArray[i];
            }

            return value;
        }

        private int CalculateValue2(int[] A, int k)
        {
            int value = 0;

            for (int i = 0; i < A.Length; i++)
            {
                int newIndex = i + k;
                if (newIndex >= A.Length)
                {
                    newIndex -= A.Length;
                }

                value += i * A[newIndex];
            }

            return value;
        }


        private int[] RotateArray(int[] A, int k)
        {
            int[] rotatedArray = new int[A.Length];
            for (int i = 0; i < A.Length; i++)
            {
                int newIndex = i + k;
                if (newIndex >= A.Length)
                {
                    newIndex -= A.Length;
                }

                rotatedArray[newIndex] = A[i];
            }

            return rotatedArray;
        }
    }

    public class Solution7
    {
        int[] nums;
        Random rand;

        public Solution7(int[] nums)
        {
            this.nums = nums;
            rand = new Random();
        }

        public int pick(int target)
        {
            for (int i = 0; i < this.nums.Length; i++)
            {
                if (nums[i] != target)
                {
                    continue;
                } 
                else
                {
                    int minIndex = i;
                    int maxIndex = i;

                    while(true)
                    {
                        if (maxIndex < nums.Length && nums[maxIndex] == target)
                        {
                            maxIndex++;
                        }
                        else
                        {
                            break;
                        }
                    }

                    return rand.Next(minIndex, maxIndex);
                }
            }

            return -1;
        }
    }

